      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "summen av fradragsberettigede kostnader som ikke er knyttet til en bestemt inntektskilde"
        },
        "remark" : {
          "nb" : "Sktl § 6-3 sier: Når fradragsberettigede kostnader overstiger inntekter fra samme inntektskilde, gis det fradrag for underskuddet i inntekt fra andre inntektskilder. Fradrag etter første ledd gis i den kommunen hvor underskuddet er oppstått. Dersom fradraget overstiger inntektene i kommunen, kan fradraget gis i andre kommuner etter § 6-90 første ledd b. Utgangspunktet er at fradrag gis i den kommunen der inntektskilden ligger. Årets underskudd (før fradrag for fordelingsfradrag) oppstått i en kommune skal først fratrekkes øvrige inntekter i samme kommune. Dersom det fortsatt er udekket underskudd i kommunen, skal underskuddet fordeles forholdsmessig mellom kommunene sammen med øvrige fordelingsfradrag, jf. sktl. § 6-90 første ledd bokstav b. Bestemmelsen innebærer at skattyter sikres fullt fradrag for hele underskuddet, uavhengig av i hvilken kommune han har sine inntektskilder. Siden alle kommuner i praksis benytter samme skattesats, får bestemmelsen bare betydning for fordelingen av skatteinntektene mellom skattekreditorene og får ingen betydning for den samlede skatt den enkelte skattyter skal betale. Sktl § 6-90 bestemmer videre at har skattyter inntekt i flere kommuner, skal følgende fradrag fordeles forholdsmessig etter størrelsen av inntekten i hver kommune: fradrag for gjeldsrenter og andre kostnader som ikke har tilknytning til noen bestemt inntektskilde."
        },
        "source" : {
          "prefLabel" : {
            "nb" : "Skatteloven § 6-3 og § 6-90 første ledd bokstav a og b."
          }
