          "nb" : "fysisk person som i siste instans eier eller kontrollerer en enhet"
        },
        "remark" : {
          "nb" : "Opplysningene skal være registrert og bekreftet av den finansielle institusjonen hvor kontoen holdes, etter hvitvaskingsbestemmelsene, sml hvitvaskingsloven § 7 første ledd, jf. § 8 femte ledd.\n\nFor eksempel; om et selskap i følge aksjeeierregisteret eies av et annet selskap, er reelle rettighetshavere de fysiske personer som eier det andre selskapet (eller det ultimate holdingselskapet i en kjede av eierskap).\n\nInformasjon om reell rettighetshaver i juridiske personer skal være avgjort etter en steg for steg vurdering, hvor man først ser på eierskapsinteresser og annen kontroll. Dersom ingen fysisk person kan identifiseres gjennom eierskap eller kontroll, skal øverste leder identifiseres. \n\nFor truster og andre innretninger er det innehavere av nærmere angitte roller som skal regnes som reelle rettighetshavere. Dette gjelder oppretter, forvalter, beskytter, begunstiget og enhver annen fysisk person som utøver endelig effektiv kontroll over trusten/innretningen."
