      "definition" : {
        "text" : {
          "nb" : "lønn og annen godtgjørelse som ikke er skattepliktig, men som er trygdeavgiftspliktig. Felles for personene dette gjelder, er at enten norsk intern rett eller en skatteavtale medfører at inntekten ikke er skattepliktig, men EØS-regelverket om trygdemedlemskap medfører at mottakeren omfattes av norske trygderegler. Inntekten er derfor trekkpliktig."
        },
        "sourceRelationship" : "egendefinert",
