      },
      "altLabel" : [ ],
      "hiddenLabel" : [ ],
      "contactPoint" : {
        "email" : "begrepskatalogen@skatteetaten.no"
      },
      "example" : {
        "nb" : "Gjelder for eksempel: Grensegjengere som er bosatt i Sverige eller Finland og som arbeider i Norge.  En grensegjenger er en person som er skattepliktig som bosatt i en kommune som direkte grenser til riksgrensen mellom Norge og Sverige eller mellom Norge og Finland og som får lønn for arbeid utført i en kommune som grenser direkte til den samme riksgrensen. Grensegjengere skal betale skatt i sitt hjemland av lønn opptjent i Norge. Dette gjelder uansett om arbeidsgiver er offentlig eller privat. Utenlandske arbeidstakere som har norsk arbeidsgiver og som driver landtransport i to eller flere EØS-land, forutsatt at lønnen er opptjent i utlandet. Flypersonell som er bosatt i utlandet med norsk arbeidsgiver og som utfører arbeid i to eller flere EØS-land. Personer som er skattemessig bosatt i et annet nordisk land og som arbeider om bord i norskregistrerte fiskefartøyer. Gjelder både inntekt opptjent i og utenfor norsk territorialfarvann. Personer som er skattemessig bosatt i et annet EØS-land som arbeider om bord i norskregistrerte fiskefartøyer. Gjelder bare inntekt opptjent utenfor norsk territorialfarvann."
      },
