      "identifier" : "http://begrepskatalogen/begrep/98da4341-dff2-11e7-a0fd-005056821322",
      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "personlig skattesubjekt, som er bosatt i et annet land enn Norge etter det andre landets interne regler og/eller etter anvendelse av skatteavtale mellom Norge og det andre land i de tilfeller hvor personen også er skattemessig bosatt i Norge etter norsk intern rett."
        },
        "source" : {
          "prefLabel" : {
            "nb" : "Skatteloven § 2-1"
          }
        },
        "sources" : [ {
