        "remark" : {
          "nb" : "Pensjonsinntekten gir ikke rett til skattefradrag etter skatteloven § 16-1. Personen kan ha rett til privat AFP hvis hun/han jobber i en privat bedrift med en tariffavtale som har privat AFP som en del av avtalen. Det er også et krav at personen har fylt 62 år, er født i 1944 eller senere, oppfyller vilkårene i Fellesordningen for AFP – som gjelder ansettelsesforhold, sykepenger, permittering, næringsinntekter med mer, tar ut minimum 20 prosent alderspensjon fra folketrygden. Har du fylt 70 år trenger du ikke å ta ut alderspensjon i tillegg, ikke tidligere har mottatt privat eller offentlig AFP, ikke har mottatt uføretrygd fra folketrygden etter fylte 62 år."
