        "text" : {
          "nb" : "fysisk person som har hovedbeskjeftigelse om bord på skip i fart og har arbeidet om bord i til sammen minst 130 dager i skattleggingsperioden"
        },
        "remark" : {
          "nb" : "Som skip i fart regnes som hovedregel: - marinefartøy med kommando heist, uavhengig av størrelse og seilt distanse. - skip i utenriksfart, som har eget fremdriftsmaskineri, uavhengig av skipets størrelse og utstrekning på skipets fartsområde. - skip som er på minst 100 brutto registertonn og har eget fremdriftsmaskineri og ikke er unntatt. - Sykdomsperioder inngår i beregningen av om skattyter har arbeidet om bord i 130 dager uavhengig av sykdommens varighet. Forutsetningen er at sykepenger erstatter hyre mv som ville kvalifisert til særskilt fradrag for sjøfolk og at det kan dokumenteres at skattyter skulle ha arbeidet om bord. Tilsvarende gjelder ved omsorgspermisjon hvor det ytes foreldrepenger fra folketrygden. Dager skattyter skulle ha arbeidet om bord, men ikke har hatt mulighet til å komme om bord som følge av uforutsette hendelser utenfor skattyterens kontroll, slik som for eksempel dårlig vær, inngår i beregningen av om skattyter har arbeidet om bord i 130 dager. Sjømann brukes som entallsform av sjøfolk."
        },
